import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import PgListings from "./pages/PgListings.jsx";
import PgDetails from "./pages/PgDetails.jsx";
import ListPg from "./pages/ListPg.jsx";
import Navbar from "./components/Navbar.jsx";
import Footer from "./components/footer.jsx";
import Main from "./pages/main.jsx"; 
import AllPgs from "./pages/AllPgs.jsx";

function App() {
  return (
    <Router>
      <div className="app-root">
        <Navbar />
        <main style={{ flex: 1 }}>
          <Routes>
            <Route path="/" element={<Main />} />
            <Route path="/all-pgs" element={<AllPgs />} />
            {/* <Route path="/pg-details/:id" element={<PgDetails />} /> */}
            <Route path="/list-pg" element={<ListPg />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
